webpackJsonp([0x80e73a003035],{3565:function(t,a){t.exports={data:{markdownRemark:{html:"<p>現行掲示板があまりに不安定なので削除。また作り直しますのでご安心を♪ 同時に初代掲示板を「問答専用掲示板」として、二代目掲示板を「雑談専用掲示板」として復活することにします。</p>\n<h2>過去2000年4月以降に新掲示板に書き込まれた方へ</h2>\n<p>誠に申し訳ございませんが新掲示板のCGIは停止致しましたので、新掲示板に書かれた記事は見ることが出来なくなっております。但しログ自体は消去してませんので、近日中リニューアルに合わせ、過去ログページとして復活する予定ですので、「自分の書いた記事のレスが見たい」方などもうしばらくお待ちください。</p>",frontmatter:{cover:null,date:"2001-06-18T18:16:00+09:00",strDate:"2001/6/18",title:"掲示板閉鎖"}}},pathContext:{path:"/ja/blog/2001/06/18-掲示板閉鎖/",langKey:"ja"}}}});
